I have to tell you - as a baby food company we get more emails about poop than I ever imagined. Turns out - smelling someone's behind is TOTALLY normal when you're a mom (who's with me 👋👋). Also - turns out that when baby's eat real baby food with whole ingredients - their poop changes (hence why we talk about poop a lot to our Amara mamas ;) But, it can be heartbreaking when your baby is straining, so here are the top 5 foods that can help relieve your baby's constipation: 
.
.
.
OATMEAL: Whole grains are packed with fiber that can help ease baby's digestion. The superstar in oatmeal is a soluble fiber called beta-glucan - the less processed - the better! 
.
.
.
PRUNES: Rich in fiber - prunes can help aid the passage of the stool in the digestive tract for your baby. At 2 grams of fiber per ounce, they're sure to get things moving in the right direction. 
.
.
.
PEARS: easy on baby's developing digestive system - these mighty warriors are high in fiber and can help alleviate baby's constipation too!
.
.
APPLES: the star of the show here is pectin, a type of fiber present in apples that can help induce bowel movements in your baby 
.
.
.
BEANS: Beans, beans... the more you eat.. the more you... you can finish the rhyme. We all know it for a reason - beans can help move things along for your baby - just make sure they are cooked well!

.
.
.
Things like warm baths, some tummy massages and helping your baby move around and get exercise can go a long way to help relieve tummy issues too. Do you have anything else you like to do to help your baby's constipation issues? Comment below to help a fellow mama out 👇👇
.
